        <Page>
                <div>
                    <div>
                        <div className="text-4xl font-bold text-center h-screen grid content-center">
                            <div className="bg-[url('../public/gift.png')] h-screen bg-contain bg-no-repeat">
                                <div className="grid content-center">
                                <h1 className="text-4xl font-bold text-center h-screen grid content-center">
                                    ABOUT US
                                </h1>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
        </Page>
    );
};
